import './article.css'

const Article = ({imgUrl, date, title}) => {
  return (
    <div className='jpt__blog-article'>
      <div className='jpt__blog-article_image'>
        <img src={imgUrl} alt="blog" />
      </div>
    </div>
  )
}

export default Article
